import React, { Component } from "react";
import Slider from "react-slick";
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import h2 from './images/h2.jpg'
import h4 from './images/h4.jpg'
import h6 from './images/greens.jpeg'
import './App.css'



export default class SimpleSlider extends Component {
  render(){
    const settings = {
      className: "center",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500
    };
  
    return (
        <div className="card">
        <Slider {...settings}>
          <div  className="car">
          <img src={h2} alt="" />
          </div>
          <div className="car">
          <img src={h4} alt="" />
          </div>
          <div className="car">
          <img src={h6} alt="" />
          </div>
          <div className="car">
          <img src={h4} alt="" />
          </div>
        </Slider>
        </div>
    );
  }
}
